}/* Including this here to ensure the animation and keyframes get included from config */
@keyframes tw_check {
0% {
border-color: #fff;
height: 0;
}
100% {
border-color: #fff;
height: 0.7em;
}
}
.do-not-modify {
animation: tw_check 100ms 250ms cubic-bezier(.4,.0,.23,1) forwards;
}
@keyframes tw_fadeIn {
0% {
opacity: 0;
}
100% {
opacity: 1;
}
}
.do-not-modify {
animation: tw_fadeIn 500ms ease forwards;
}
@keyframes tw_fadeOut {
0% {
opacity: 1;
}
100% {
opacity: 0;
}
}
.do-not-modify {
animation: tw_fadeOut 500ms ease-out forwards;
}
@keyframes tw_slideDown {
0% {
opacity: 1;
top: 0%;
}
50% {
opacity: 1;
top: 35%;
}
100% {
opacity: 0;
top: 50%;
}
}
.do-not-modify {
animation: tw_slideDown 100ms ease-out forwards;
}
@keyframes tw_slideUp {
0% {
opacity: 0;
top: 50%;
}
50% {
opacity: 1;
top: 15%;
}
100% {
opacity: 1;
top: 0;
}
}
.do-not-modify {
animation: tw_slideUp 100ms ease-out forwards;
}
@keyframes tw_radio {
0% {
transform: scale(0);
}
33% {
transform: scale(0.5);
}
80% {
transform: scale(0.9);
}
100% {
transform: scale(0.8);
}
}
.do-not-modify {
animation: tw_radio 125ms 150ms cubic-bezier(.4,.0,.23,1) forwards;
}
@keyframes tw_squish {
0% {
transform: scale(1);
}
33% {
transform: scale(.85);
}
100% {
transform: scale(1);
}
}
.do-not-modify {
animation: tw_squish 200ms cubic-bezier(.4,.0,.23,1);
}
